BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "account_movements" (
	"id"	INTEGER,
	"numero_operacion"	INTEGER NOT NULL CHECK("numero_operacion" > 0),
	"entity_id"	INTEGER NOT NULL,
	"created_at"	TEXT DEFAULT CURRENT_TIMESTAMP,
	"descripcion"	TEXT,
	"medio_pago"	TEXT,
	"numero_de_comprobante"	TEXT,
	"purchase_id"	INTEGER,
	"debe"	REAL,
	"haber"	REAL,
	"saldo"	REAL,
	"file_id"	INTEGER,
	"updated_at"	TEXT DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY("id" SERIAL),
	FOREIGN KEY("entity_id") REFERENCES "entities"("id"),
	FOREIGN KEY("file_id") REFERENCES "file_attachments"("id"),
	FOREIGN KEY("purchase_id") REFERENCES "purchases"("id")
);
CREATE TABLE IF NOT EXISTS "barcodes" (
	"id"	INTEGER,
	"barcode"	TEXT NOT NULL UNIQUE,
	"product_id"	INTEGER,
	PRIMARY KEY("id" SERIAL),
	FOREIGN KEY("product_id") REFERENCES "products"("barcode")
);
CREATE TABLE IF NOT EXISTS "brands" (
	"id"	INTEGER,
	"brand_name"	TEXT NOT NULL UNIQUE,
	"description"	TEXT,
	"creation_date"	TEXT NOT NULL DEFAULT (datetime('now', 'localtime')),
	"last_modified_date"	TEXT,
	PRIMARY KEY("id" SERIAL)
);
CREATE TABLE IF NOT EXISTS "colors" (
	"id"	INTEGER,
	"color_name"	TEXT NOT NULL,
	"color_hex"	TEXT NOT NULL,
	PRIMARY KEY("id" SERIAL)
);
CREATE TABLE IF NOT EXISTS "entities" (
	"id"	INTEGER,
	"entity_name"	TEXT NOT NULL,
	"entity_type"	TEXT NOT NULL,
	"razon_social"	TEXT NOT NULL,
	"responsabilidad_iva"	INTEGER NOT NULL,
	"domicilio_comercial"	TEXT NOT NULL,
	"cuit"	TEXT NOT NULL UNIQUE,
	"inicio_actividades"	TEXT,
	"ingresos_brutos"	TEXT,
	"contact_name"	TEXT,
	"phone_number"	TEXT,
	"email"	TEXT,
	"observations"	TEXT,
	PRIMARY KEY("id" SERIAL)
);
CREATE TABLE IF NOT EXISTS "file_attachments" (
	"id"	INTEGER,
	"file_name"	TEXT NOT NULL,
	"file_extension"	TEXT NOT NULL,
	"file_content"	BYTEA NOT NULL,
	"upload_date"	TEXT DEFAULT CURRENT_TIMESTAMP,
	"comment"	TEXT,
	PRIMARY KEY("id" SERIAL)
);
CREATE TABLE IF NOT EXISTS "groups" (
	"id"	INTEGER,
	"group_name"	TEXT NOT NULL,
	"parent_group_id"	INTEGER,
	"marked_as_root"	INTEGER NOT NULL DEFAULT 0,
	PRIMARY KEY("id" SERIAL),
	FOREIGN KEY("parent_group_id") REFERENCES "groups"("id")
);
CREATE TABLE IF NOT EXISTS "images" (
	"id"	INTEGER,
	"image_data"	BYTEA NOT NULL,
	"product_id"	INTEGER,
	PRIMARY KEY("id" SERIAL),
	FOREIGN KEY("product_id") REFERENCES "products"("id")
);
CREATE TABLE IF NOT EXISTS "inventory_movements" (
	"id"	INTEGER,
	"inventory_movements_group_id"	INTEGER NOT NULL,
	"product_id"	INTEGER NOT NULL,
	"quantity"	INTEGER NOT NULL CHECK("quantity" > 0),
	"discount"	REAL DEFAULT 0.0,
	"subtotal"	REAL NOT NULL,
	"total"	REAL NOT NULL,
	"movement_date"	TEXT DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY("id" SERIAL),
	FOREIGN KEY("inventory_movements_group_id") REFERENCES "inventory_movements_groups"("id"),
	FOREIGN KEY("product_id") REFERENCES "products"("id")
);
CREATE TABLE IF NOT EXISTS "inventory_movements_groups" (
	"id"	INTEGER,
	"origin_branch_id"	INTEGER NOT NULL,
	"destination_branch_id"	INTEGER NOT NULL,
	"status"	TEXT NOT NULL DEFAULT 'empacado',
	"movement_type"	TEXT NOT NULL DEFAULT 'transfer',
	"created_at"	TEXT DEFAULT CURRENT_TIMESTAMP,
	"updated_at"	TEXT DEFAULT CURRENT_TIMESTAMP,
	"shipped_at"	TEXT,
	"delivered_at"	TEXT,
	"received_at"	TEXT,
	"created_by_user_id"	INTEGER,
	"updated_by_user_id"	INTEGER,
	"notes"	TEXT,
	PRIMARY KEY("id" SERIAL),
	FOREIGN KEY("created_by_user_id") REFERENCES "users"("id"),
	FOREIGN KEY("destination_branch_id") REFERENCES "storage"("id"),
	FOREIGN KEY("origin_branch_id") REFERENCES "storage"("id"),
	FOREIGN KEY("updated_by_user_id") REFERENCES "users"("id")
);
CREATE TABLE IF NOT EXISTS "product_colors" (
	"id"	INTEGER,
	"product_id"	INTEGER NOT NULL,
	"color_id"	INTEGER NOT NULL,
	"created_at"	TEXT DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY("id" SERIAL),
	FOREIGN KEY("color_id") REFERENCES "colors"("id"),
	FOREIGN KEY("product_id") REFERENCES "products"("id")
);
CREATE TABLE IF NOT EXISTS "product_sizes" (
	"id"	INTEGER,
	"product_id"	INTEGER NOT NULL,
	"size_id"	INTEGER NOT NULL,
	"created_at"	TEXT DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY("id" SERIAL),
	FOREIGN KEY("product_id") REFERENCES "products"("id"),
	FOREIGN KEY("size_id") REFERENCES "sizes"("id")
);
CREATE TABLE IF NOT EXISTS "products" (
	"id"	INTEGER,
	"provider_code"	TEXT,
	"product_name"	TEXT NOT NULL,
	"group_id"	INTEGER,
	"provider_id"	INTEGER,
	"description"	TEXT,
	"cost"	REAL,
	"sale_price"	REAL,
	"tax"	REAL,
	"discount"	REAL,
	"comments"	TEXT,
	"user_id"	INTEGER,
	"images_ids"	TEXT,
	"brand_id"	INTEGER,
	"creation_date"	TEXT NOT NULL DEFAULT (datetime('now', 'localtime')),
	"last_modified_date"	TEXT,
	"original_price"	REAL DEFAULT 0,
	"discount_percentage"	REAL DEFAULT 0,
	"discount_amount"	REAL DEFAULT 0,
	"has_discount"	INTEGER DEFAULT 0,
	PRIMARY KEY("id" SERIAL),
	FOREIGN KEY("brand_id") REFERENCES "brands"("id"),
	FOREIGN KEY("group_id") REFERENCES "groups"("id"),
	FOREIGN KEY("user_id") REFERENCES "users"("id")
);
CREATE TABLE IF NOT EXISTS "proveedorxmarca" (
	"id_brand"	INTEGER NOT NULL,
	"id_provider"	INTEGER NOT NULL,
	PRIMARY KEY("id_brand","id_provider"),
	FOREIGN KEY("id_brand") REFERENCES "brands"("id"),
	FOREIGN KEY("id_provider") REFERENCES "entities"("id")
);
CREATE TABLE IF NOT EXISTS "purchases" (
	"id"	INTEGER,
	"entity_id"	INTEGER,
	"purchase_date"	TEXT DEFAULT CURRENT_TIMESTAMP,
	"subtotal"	REAL NOT NULL,
	"discount"	REAL DEFAULT 0.0,
	"total"	REAL NOT NULL,
	"payment_method"	TEXT,
	"transaction_number"	TEXT,
	"invoice_number"	TEXT,
	"notes"	TEXT,
	"file_id"	INTEGER,
	"status"	TEXT DEFAULT 'Pendiente de entrega',
	"delivery_date"	TEXT,
	PRIMARY KEY("id" SERIAL),
	FOREIGN KEY("entity_id") REFERENCES "entities"("id"),
	FOREIGN KEY("file_id") REFERENCES "file_attachments"("id")
);
CREATE TABLE IF NOT EXISTS "purchases_detail" (
	"id"	INTEGER,
	"purchase_id"	INTEGER NOT NULL,
	"product_id"	INTEGER,
	"cost_price"	REAL NOT NULL,
	"quantity"	INTEGER NOT NULL CHECK("quantity" > 0),
	"discount"	REAL DEFAULT 0.0,
	"subtotal"	REAL NOT NULL,
	"metadata"	TEXT,
	PRIMARY KEY("id" SERIAL),
	FOREIGN KEY("product_id") REFERENCES "products"("id"),
	FOREIGN KEY("purchase_id") REFERENCES "purchases"("id")
);
CREATE TABLE IF NOT EXISTS "responsabilidades_afip" (
	"id"	INTEGER,
	"codigo"	INTEGER NOT NULL,
	"descripcion"	TEXT NOT NULL,
	PRIMARY KEY("id")
);
CREATE TABLE IF NOT EXISTS "sales" (
	"id"	INTEGER,
	"customer_id"	INTEGER,
	"employee_id"	INTEGER NOT NULL,
	"cashier_user_id"	INTEGER NOT NULL,
	"storage_id"	INTEGER NOT NULL,
	"sale_date"	TEXT DEFAULT CURRENT_TIMESTAMP,
	"subtotal"	REAL NOT NULL,
	"tax_amount"	REAL DEFAULT 0.0,
	"discount"	REAL DEFAULT 0.0,
	"total"	REAL NOT NULL,
	"payment_method"	TEXT NOT NULL,
	"payment_reference"	TEXT,
	"invoice_number"	TEXT,
	"receipt_number"	TEXT,
	"notes"	TEXT,
	"status"	TEXT DEFAULT 'Completada',
	"refund_reason"	TEXT,
	"refunded_at"	TEXT,
	"created_at"	TEXT DEFAULT CURRENT_TIMESTAMP,
	"updated_at"	TEXT DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY("id" SERIAL),
	FOREIGN KEY("cashier_user_id") REFERENCES "users"("id"),
	FOREIGN KEY("customer_id") REFERENCES "entities"("id"),
	FOREIGN KEY("employee_id") REFERENCES "entities"("id"),
	FOREIGN KEY("storage_id") REFERENCES "storage"("id")
);
CREATE TABLE IF NOT EXISTS "sales_detail" (
	"id"	INTEGER,
	"sale_id"	INTEGER NOT NULL,
	"product_id"	INTEGER NOT NULL,
	"variant_id"	INTEGER,
	"product_name"	TEXT NOT NULL,
	"product_code"	TEXT,
	"size_name"	TEXT,
	"color_name"	TEXT,
	"cost_price"	REAL NOT NULL,
	"sale_price"	REAL NOT NULL,
	"quantity"	INTEGER NOT NULL CHECK("quantity" > 0),
	"discount_percentage"	REAL DEFAULT 0.0,
	"discount_amount"	REAL DEFAULT 0.0,
	"tax_percentage"	REAL DEFAULT 0.0,
	"tax_amount"	REAL DEFAULT 0.0,
	"subtotal"	REAL NOT NULL,
	"total"	REAL NOT NULL,
	"profit_margin"	REAL,
	"barcode_scanned"	TEXT,
	"created_at"	TEXT DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY("id" SERIAL),
	FOREIGN KEY("product_id") REFERENCES "products"("id"),
	FOREIGN KEY("sale_id") REFERENCES "sales"("id"),
	FOREIGN KEY("variant_id") REFERENCES "warehouse_stock_variants"("id")
);
CREATE TABLE IF NOT EXISTS "sessions" (
	"id"	INTEGER,
	"user_id"	INTEGER NOT NULL,
	"storage_id"	INTEGER,
	"session_token"	TEXT NOT NULL UNIQUE,
	"login_time"	TEXT DEFAULT CURRENT_TIMESTAMP,
	"last_activity"	TEXT DEFAULT CURRENT_TIMESTAMP,
	"is_active"	INTEGER DEFAULT 1,
	"ip_address"	TEXT,
	"user_agent"	TEXT,
	PRIMARY KEY("id" SERIAL),
	FOREIGN KEY("storage_id") REFERENCES "storage"("id"),
	FOREIGN KEY("user_id") REFERENCES "users"("id")
);
CREATE TABLE IF NOT EXISTS "size_categories" (
	"id"	INTEGER,
	"category_name"	TEXT NOT NULL UNIQUE,
	"permanent"	BOOLEAN NOT NULL DEFAULT 0,
	PRIMARY KEY("id" SERIAL)
);
CREATE TABLE IF NOT EXISTS "sizes" (
	"id"	INTEGER,
	"size_name"	TEXT NOT NULL,
	"category_id"	INTEGER NOT NULL,
	"description"	TEXT,
	PRIMARY KEY("id" SERIAL),
	FOREIGN KEY("category_id") REFERENCES "size_categories"("id")
);
CREATE TABLE IF NOT EXISTS "storage" (
	"id"	INTEGER,
	"name"	TEXT NOT NULL,
	"address"	TEXT,
	"postal_code"	TEXT,
	"phone_number"	TEXT,
	"area"	TEXT,
	"description"	TEXT,
	"created_at"	TEXT DEFAULT (datetime('now', 'localtime')),
	"status"	TEXT DEFAULT 'Activo',
	PRIMARY KEY("id" SERIAL)
);
CREATE TABLE IF NOT EXISTS "users" (
	"id"	INTEGER,
	"username"	TEXT UNIQUE,
	"fullname"	TEXT,
	"password"	TEXT,
	"email"	TEXT,
	"phone"	TEXT,
	"domicilio"	TEXT,
	"cuit"	TEXT NOT NULL UNIQUE,
	"role"	TEXT,
	"status"	TEXT,
	"session_token"	TEXT,
	"profile_image"	BYTEA,
	"created_at"	TEXT DEFAULT (datetime('now', 'localtime')),
	PRIMARY KEY("id" SERIAL)
);
CREATE TABLE IF NOT EXISTS "usersxstorage" (
	"id_user"	INTEGER NOT NULL,
	"id_storage"	INTEGER NOT NULL,
	PRIMARY KEY("id_user","id_storage"),
	FOREIGN KEY("id_storage") REFERENCES "storage"("id"),
	FOREIGN KEY("id_user") REFERENCES "users"("id")
);
CREATE TABLE IF NOT EXISTS "warehouse_stock" (
	"id"	INTEGER,
	"product_id"	INTEGER NOT NULL,
	"branch_id"	INTEGER NOT NULL,
	"quantity"	INTEGER NOT NULL CHECK("quantity" >= 0),
	"last_updated"	TEXT DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY("id" SERIAL),
	FOREIGN KEY("branch_id") REFERENCES "storage"("id"),
	FOREIGN KEY("product_id") REFERENCES "products"("id")
);
CREATE TABLE IF NOT EXISTS "warehouse_stock_variants" (
	"id"	INTEGER,
	"product_id"	INTEGER NOT NULL,
	"size_id"	INTEGER,
	"color_id"	INTEGER,
	"branch_id"	INTEGER NOT NULL,
	"quantity"	INTEGER NOT NULL DEFAULT 0 CHECK("quantity" >= 0),
	"variant_barcode"	TEXT,
	"last_updated"	TEXT DEFAULT CURRENT_TIMESTAMP,
	PRIMARY KEY("id" SERIAL),
	FOREIGN KEY("branch_id") REFERENCES "storage"("id"),
	FOREIGN KEY("color_id") REFERENCES "colors"("id"),
	FOREIGN KEY("product_id") REFERENCES "products"("id"),
	FOREIGN KEY("size_id") REFERENCES "sizes"("id")
);
